logicDescription:
source: 13700;
hashTag:  ; #epi1093, #ONC, #RequireFutureTime,#Deprecated;
submitter: Nate Hall, Dmytro Dymshyts  
logic: Earliest event of Non-small cell lung cancer (NSCLC), indexed on the earliest diagnosis of Primary Lung Cancer,  meeting the following criteria 1) another diagnosis (code) of primary lung cancer within 1 year after index AND 2) Has no exposure of small cell lung cancer specific drugs/treatments  in the year post index or anytime prior index, and 3) has no diagnosis of small cell lung cancer in the year post index or anytime prior index 4) has no observation suggesting  of small cell lung cancer in the year post index or anytime prior index 5) has no Malignant neoplasm of upper respiratory tract in the year post index or anytime prior index. Cohort exist is the end of continuous observation.

